};

// Social Media Links

const socialMediaLinks = {
  github: "https://github.com/goelayush89",
  linkedin: "https://www.linkedin.com/in/ayushgoel1729/",
  gmail: "goela093@gmail.com",
  leetcode: "https://leetcode.com/goela093/",

  // Instagram, Twitter and Kaggle are also supported in the links!
