  title: " Projects",
  subtitle: "SOME PERSONAL PROJECTS I HAVE WORKED ON",
  projects: [
    {
      image: require("./assets/images/saayaHealthLogo.webp"),
      projectName: "Qbit Simulator",
      projectDesc: "A simulator to implement quantum circuits you can use qiskit as well as OpenQASM 2.0 code editor.Also analyse and implement probability metrics and graph using ChartJs",
