      projectDesc: "Packet Sniffer created in Python 3. Allows you to monitor traffic running through local network. Allows the user to be able to view Source of the packets, Target host and the type of protocol used e.g. UDP/TCP.",
      footerLink: [
        {
          name: "Visit Website",
          url: "https://github.com/goelayush89/Network-packet-sniffer"
